  \"Environmental Friendly Coatings &amp; Corrosion Prevention for Flight Hardware
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
