  \"environmental-friendly-coatings-amp-corrosion-prevention-for-flight-hardware-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;Kennedy Space Center (KSC) has
  undertaken a study to find environmentally friendly alternatives for the petroleum
  and solvent-based corrosion-preventive compounds (CPCs) used to protect flight hardware
  and ground support equipment. Film-forming CPCs leave either a soft or hard protective
  barrier that prevents moisture from directly contacting metallic surfaces, whereas
  thin and ultra-thin wicking CPCs displace moisture in cracks and crevices and leave
  a residue that repels further moisture. To protect an occluded region, the CPC must
  either form a barrier over the crevice mount or wick into the occluded region. In
  both film-forming and wicking CPCs, corrosion inhibitors are often suspended in
  a mixture of solvents and a base oil or grease. The base oil acts as a carrier fluid
  for the inhibitors and as a moisture barrier. The solvent, which is intended to
  evaporate after application, acts as a base oil and disperses the inhibitor. Although
  CPCs can be effective, the base oils are not environmentally benign and the solvents
  can be toxic and high in volatile organic compounds (VOCs).&lt;/p&gt;&lt;p&gt;The
  candidates tested for use at&amp;nbsp; KSC were soft-film CPCs, both common petroleum-based
  and newer environmentally friendly types. For this program, &amp;ldquo;environmentally
  friendly&amp;rdquo; refers to CPCs that are low in VOCs (less than 100&amp;nbsp;g/L),
  are not hazardous air pollutants, are nontoxic, and are non-carcinogenic. In Phase
  1, the CPCs were applied to various steel and aluminum substrates, which were subjected
  to atmospheric exposure testing at KSC&amp;rsquo;s Beachside Atmospheric Corrosion
  Test Site, as well as to cyclic accelerated corrosion testing. Phase 2 consists
  of more rigorous testing of the down selected CPCs from Phase 1, new testing of
  hard-film CPCs, and a study of the failure mechanisms of the different CPC types.
  Phase 3 testing will determine end use application parameters, including material
  life cycles, application frequency, and compatibility testing with the specific
  end uses at the Kennedy Space Center so that they can be incorporated into current
  applications and future flight hardware and ground support uses.&amp;nbsp;&lt;/p&gt;\",\n\t\"license_title\":
